import axios from "axios";

export const ApiPost = async (url, body) => {
  const config = {
    headers: {
      "Content-Type": "application/json",
    },
  };
  await axios.post(url, JSON.stringify(body), config).then((res) => {
    console.log("errorssssss", res);
  });
  //   try {
  //     return res;
  //   } catch (error) {
  //     if (res.errors) {
  //       console.log("errors123");
  //     }
  //   }
};

export const ApiGet = async (url) => {
  const config = {
    headers: {
      "Content-Type": "application/json",
    },
  };
  return await axios.get(url, config);
};
